--
-- Name: v_detalle_diario; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_detalle_diario WITH (security_barrier='true') AS
 SELECT e.nombre AS establecimiento,
    emp.nombre AS empresa,
    dd.fecha,
    dd.categoria,
    dd.concepto,
    dd.valor,
    dd.empresa_id
   FROM ((public.datos_diarios dd
     JOIN public.establecimientos e ON ((dd.establecimiento_id = e.id)))
     JOIN public.empresas emp ON ((dd.empresa_id = emp.id)));


