--
-- Name: v_ranking_semanal; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_ranking_semanal AS
 SELECT e.nombre AS establecimiento,
    emp.nombre AS empresa,
    ds.semana,
    ds.anio,
    ds.vacas_masa,
    ds.vacas_en_ordena,
    ds.carga_animal,
    ds.porcentaje_grasa,
    ds.proteinas,
    ds.costo_promedio_concentrado,
    ds.grms_concentrado_por_litro,
    ds.kg_ms_concentrado_vaca,
    ds.kg_ms_conservado_vaca,
    ds.praderas_otros_verdes,
    ds.total_ms,
    ds.produccion_promedio,
    ds.costo_racion_vaca,
    ds.precio_leche,
    ds.mdat_litros_vaca_dia,
    ds.porcentaje_costo_alimentos,
    ds.mdat,
    rank() OVER (ORDER BY ds.mdat DESC NULLS LAST) AS ranking_mdat
   FROM ((public.datos_semanales ds
     JOIN public.establecimientos e ON ((ds.establecimiento_id = e.id)))
     JOIN public.empresas emp ON ((ds.empresa_id = emp.id)));


ALTER VIEW public.v_ranking_semanal OWNER TO postgres;

